        "description": "Jimmy Fallon hosts all-star music game nights! Ariana Grande and Kelly Clarkson go mic-to-mic in a Mixtape Medley showdown singing their rendition of popular songs from iconic pop divas such as Whitney Houston, Celine Dion, Britney Spears, Shania Twain and Cher. Watch That’s My Jam, Mondays 9/8c on NBC.\n\nABOUT THAT’S MY JAM\n\nHosted by Jimmy Fallon, “That’s My Jam” is an hourlong music and comedy variety game show that draws inspiration from the most popular “Tonight Show” games. Each episode features two teams of two celebrities competing for a charity of their choice in a series of music, dance, and trivia-based games and musical performances. Signature games to be played include Launch the Mic, Air Guitar, Don’t Drop the Beat, Perfect Mash-Up, Wheel of Impossible Karaoke, Slay It, Don’t Spray It and many more.\n\nThe format was brought to Universal Television Alternative Studio by Fallon, longtime “The Tonight Show” producer Jim Juvonen and writer Josh Knapp. Adam Blackstone is Musical Director and will lead the house band throughout each episode. Mike Yurchuk will serve as showrunner.\n\nThat’s My Jam Hosted by Jimmy Fallon. Stream now on Peacock: https://bit.ly/3gZJaNy\n\nSubscribe NOW to The Tonight Show Starring Jimmy Fallon: http://bit.ly/1nwT1aN\n\nGet more That’s My Jam: https://www.nbc.com/thats-my-jam\n\nJIMMY FALLON ON SOCIAL\nFollow Jimmy: http://Twitter.com/JimmyFallon\nLike Jimmy: https://Facebook.com/JimmyFallon\nFollow Jimmy: https://www.instagram.com/jimmyfallon/\n\nTHAT’S MY JAM ON SOCIAL\nFollow That’s My Jam: https://mobile.twitter.com/nbcthatsmyjam\nLike That’s My Jam: https://www.facebook.com/NBCThatsMyJam\n\nGET MORE NBC\nNBC YouTube: http://bit.ly/1dM1qBH\nLike NBC: http://Facebook.com/NBC\nFollow NBC: http://Twitter.com/NBC\nNBC Instagram: http://instagram.com/nbc\nNBC Tumblr: http://nbctv.tumblr.com/\n\nMixtape Medley with Ariana Grande and Kelly Clarkson | That’s My Jam\nhttp://www.youtube.com/fallontonight\n\n